description:
Jo Brand Barely Live (2003)

Following her sell out run at the Edinburgh Festival and playing to packed houses throughout her UK tour, Jo hits London's West End with a no holds barred seventy minutes sell out show at the world famous Adelphi Theatre.

Jo will take you on a hilarious journey that is her life, whilst discussing the finer points of alcohol, motherhood and the stresses of approaching middle age.

